import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';

function App() {
  const [destination, setDestination] = useState('');
  const [duration, setDuration] = useState('');
  const [budget, setBudget] = useState('');
  const [preferences, setPreferences] = useState('');
  const [purpose, setPurpose] = useState('');
  const [itinerary, setItinerary] = useState('');
  const [chatMessages, setChatMessages] = useState([]);
  const [currentMessage, setCurrentMessage] = useState('');
  const [sessionId, setSessionId] = useState('');
  const chatContainerRef = useRef(null);

  useEffect(() => {
    setSessionId(Math.random().toString(36).substring(7));
  }, []);

  useEffect(() => {
    if (chatContainerRef.current) {
      chatContainerRef.current.scrollTop = chatContainerRef.current.scrollHeight;
    }
  }, [chatMessages]);

  const generateItinerary = async () => {
    try {
      const response = await axios.post('http://localhost:5000/generate', {
        destination,
        duration,
        budget,
        preferences,
        purpose
      });
      setItinerary(response.data.response);
      setChatMessages([{ sender: 'AI', text: response.data.response }]);
    } catch (error) {
      console.error('Error generating itinerary:', error);
      setItinerary('Error generating itinerary. Please try again.');
    }
  };

  const sendMessage = async () => {
    if (currentMessage.trim() === '') return;

    setChatMessages(prev => [...prev, { sender: 'User', text: currentMessage }]);
    setCurrentMessage('');

    try {
      const response = await axios.post('http://localhost:5000/chat', {
        sessionId,
        message: currentMessage,
        itineraryData: {
          destination,
          duration,
          budget,
          preferences,
          purpose
        }
      });

      setChatMessages(prev => [...prev, { sender: 'AI', text: response.data.response }]);

      if (response.data.flightData && response.data.flightData.length > 0) {
        const flightInfo = response.data.flightData.map(flight => 
          `${flight.airline}: ${flight.price} (${flight.duration})`
        ).join('\n');
        setChatMessages(prev => [...prev, { sender: 'AI', text: `Flight options:\n${flightInfo}` }]);
      }
    } catch (error) {
      console.error('Chat error:', error);
      setChatMessages(prev => [...prev, { 
        sender: 'AI', 
        text: "Sorry, I encountered an error while processing your request." 
      }]);
    }
  };

  return (
    <div className="App">
      <h1>AI Travel Planner</h1>
      <div>
        <input
          type="text"
          placeholder="Destination"
          value={destination}
          onChange={(e) => setDestination(e.target.value)}
        />
        <input
          type="text"
          placeholder="Duration (days)"
          value={duration}
          onChange={(e) => setDuration(e.target.value)}
        />
        <input
          type="text"
          placeholder="Budget"
          value={budget}
          onChange={(e) => setBudget(e.target.value)}
        />
        <input
          type="text"
          placeholder="Preferences"
          value={preferences}
          onChange={(e) => setPreferences(e.target.value)}
        />
        <input
          type="text"
          placeholder="Purpose"
          value={purpose}
          onChange={(e) => setPurpose(e.target.value)}
        />
        <button onClick={generateItinerary}>Generate Itinerary</button>
      </div>
      <div ref={chatContainerRef} style={{ height: '300px', overflowY: 'scroll', border: '1px solid #ccc', padding: '10px', marginTop: '20px' }}>
        {chatMessages.map((msg, index) => (
          <div key={index} style={{ marginBottom: '10px' }}>
            <strong>{msg.sender}:</strong> {msg.text}
          </div>
        ))}
      </div>
      <div>
        <input
          type="text"
          value={currentMessage}
          onChange={(e) => setCurrentMessage(e.target.value)}
          onKeyPress={(e) => e.key === 'Enter' && sendMessage()}
          placeholder="Type your message..."
          style={{ width: '80%' }}
        />
        <button onClick={sendMessage}>Send</button>
      </div>
    </div>
  );
}

export default App;
